const codesystemHierarchyMeaning = {"resourceType":"CodeSystem","id":"codesystem-hierarchy-meaning","meta":{"lastUpdated":"2022-05-28T13:47:40.239+11:00","profile":["http://hl7.org/fhir/StructureDefinition/shareablecodesystem"]},"text":{"status":"generated","div":"<div xmlns=\"http://www.w3.org/1999/xhtml\">\n      \n      <h2>CodeSystemHierarchyMeaning</h2>\n      \n      <div>\n        \n        <p>The meaning of the hierarchy of concepts in a code system.</p>\n\n      \n      </div>\n      \n      <p>This code system http://hl7.org/fhir/codesystem-hierarchy-meaning defines the following codes:</p>\n      \n      <table class=\"codes\">\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">\n            \n            <b>Code</b>\n          \n          </td>\n          \n          <td>\n            \n            <b>Display</b>\n          \n          </td>\n          \n          <td>\n            \n            <b>Definition</b>\n          \n          </td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">grouped-by\n            \n            <a name=\"codesystem-hierarchy-meaning-grouped-by\"> </a>\n          \n          </td>\n          \n          <td>Grouped By</td>\n          \n          <td>No particular relationship between the concepts can be assumed, except what can be determined by inspection of the definitions of the elements (possible reasons to use this: importing from a source where this is not defined, or where various parts of the hierarchy have different meanings).</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">is-a\n            \n            <a name=\"codesystem-hierarchy-meaning-is-a\"> </a>\n          \n          </td>\n          \n          <td>Is-A</td>\n          \n          <td>A hierarchy where the child concepts have an IS-A relationship with the parents - that is, all the properties of the parent are also true for its child concepts. Not that is-a is a property of the concepts, so additional subsumption relationships may be defined using properties or the [subsumes](extension-codesystem-subsumes.html) extension.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">part-of\n            \n            <a name=\"codesystem-hierarchy-meaning-part-of\"> </a>\n          \n          </td>\n          \n          <td>Part Of</td>\n          \n          <td>Child elements list the individual parts of a composite whole (e.g. body site).</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">classified-with\n            \n            <a name=\"codesystem-hierarchy-meaning-classified-with\"> </a>\n          \n          </td>\n          \n          <td>Classified With</td>\n          \n          <td>Child concepts in the hierarchy may have only one parent, and there is a presumption that the code system is a &quot;closed world&quot; meaning all things must be in the hierarchy. This results in concepts such as &quot;not otherwise classified.&quot;.</td>\n        \n        </tr>\n      \n      </table>\n    \n    </div>"},"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-wg","valueCode":"vocab"},{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-standards-status","valueCode":"normative"},{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-normative-version","valueCode":"4.0.0"},{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-fmm","valueInteger":5}],"url":"http://hl7.org/fhir/codesystem-hierarchy-meaning","identifier":[{"system":"urn:ietf:rfc:3986","value":"urn:oid:2.16.840.1.113883.4.642.4.785"}],"version":"4.3.0","name":"CodeSystemHierarchyMeaning","title":"CodeSystemHierarchyMeaning","status":"active","experimental":false,"date":"2021-01-17T07:06:13+11:00","publisher":"HL7 (FHIR Project)","contact":[{"telecom":[{"system":"url","value":"http://hl7.org/fhir"},{"system":"email","value":"fhir@lists.hl7.org"}]}],"description":"The meaning of the hierarchy of concepts in a code system.","caseSensitive":true,"valueSet":"http://hl7.org/fhir/ValueSet/codesystem-hierarchy-meaning","content":"complete","concept":[{"code":"grouped-by","display":"Grouped By","definition":"No particular relationship between the concepts can be assumed, except what can be determined by inspection of the definitions of the elements (possible reasons to use this: importing from a source where this is not defined, or where various parts of the hierarchy have different meanings)."},{"code":"is-a","display":"Is-A","definition":"A hierarchy where the child concepts have an IS-A relationship with the parents - that is, all the properties of the parent are also true for its child concepts. Not that is-a is a property of the concepts, so additional subsumption relationships may be defined using properties or the [subsumes](extension-codesystem-subsumes.html) extension."},{"code":"part-of","display":"Part Of","definition":"Child elements list the individual parts of a composite whole (e.g. body site)."},{"code":"classified-with","display":"Classified With","definition":"Child concepts in the hierarchy may have only one parent, and there is a presumption that the code system is a \"closed world\" meaning all things must be in the hierarchy. This results in concepts such as \"not otherwise classified.\"."}]};